import Link from "next/link";

const linkStyle = {
  marginLeft: 15,
  fontWeight: "bold",
  fontSize: "large",
  color: "orange"
};

const headerStyle = {
  backgroundColor: "gray",
  display: "flex",
  flexDirection: "row",
  width: "100vw"
};

const Header = () => (
  <div style={headerStyle}>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>
  </div>
);

export default Header;
